#Requires -Version 2

$Culturally = ""
$Briquettes = ""
$Impeccable = ""
$Insatiably = ""
$Deductions = ""
$Moderately = ""
$Shipwright = ""
$Cincinnati = ""
$Burlesqued = ""
$Darjeeling = ""
$Asseverate = ""
$Conversing = ""
$Treatments = ""
$Tantalized = ""
$Gravelling = ""
$Chilliness = ""
$Profession = ""
$Calibrated = ""
$Eventually = ""
$Grotesques = ""
$Wealthiest = ""
$Unwieldier = ""
$Indecision = ""
$Assailable = ""
$Inflection = ""

$Modules = @($Culturally,$Briquettes,$Impeccable,$Insatiably,$Deductions,$Moderately,$Shipwright,$Cincinnati,$Burlesqued,$Darjeeling,$Asseverate,$Conversing,$Treatments,$Tantalized,$Gravelling,$Chilliness,$Profession,$Calibrated,$Eventually,$Grotesques,$Wealthiest,$Unwieldier,$Indecision,$Assailable,$Inflection)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Culturally","Briquettes","Impeccable","Insatiably","Deductions","Moderately","Shipwright","Cincinnati","Burlesqued","Darjeeling","Asseverate","Conversing","Treatments","Tantalized","Gravelling","Chilliness","Profession","Calibrated","Eventually","Grotesques","Wealthiest","Unwieldier","Indecision","Assailable","Inflection") | ForEach-Object { Remove-Variable -Name $_ }
